import './App.css';
import './components/Gallery';
import { Gallery } from './components/Gallery';
import { 
  BrowserRouter,
  Switch,
  Route
 } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
            <Route path ="/" element={<Gallery/>}/>
        </Switch>
      </BrowserRouter>
        <Gallery/>
    </div>
  );
}

export default App;
